import React from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';
import * as RiIcons from 'react-icons/ri';

export const SidebarData = [
    {
        title: 'Overview',
        path: '/overview',
        icon: <AiIcons.AiFillHome/>,
        iconClosed: <RiIcons.RiArrowDownSFill/>,
        iconOpened: <RiIcons.RiArrowUpSFill/>,

        subNav: [
            {
                title: 'Users',
                path: '/overview/users',
                icon: <IoIcons.IoIosPaper/>
            },
            {
                title: 'Revenue',
                path: '/overview/revenue',
                icon: <IoIcons.IoIosPaper/>
            }
        ]
    },
    {
        title: 'Reports',
        path: '/reports',
        icon: <IoIcons.IoIosPaper/>,
        iconClosed: <RiIcons.RiArrowDownSFill/>,
        iconOpened: <RiIcons.RiArrowUpSFill/>,

        subNav: [
            {
                title: 'Reports',
                path: '/reports/reports1',
                icon: <IoIcons.IoIosPaper/>,
                cName: 'sub-nav'
            },
            {
                title: 'Reports 2',
                path: '/reports/reports2',
                icon: <IoIcons.IoIosPaper/>,
                cName: 'sub-nav'
            },
            {
                title: 'Reports 3',
                path: '/reports/reports3',
                icon: <IoIcons.IoIosPaper/>
            }
        ]
    },
    {
        title: 'Products',
        path: '/products',
        icon: <FaIcons.FaCartPlus/>
    },
    {
        title: 'Team',
        path: '/team',
        icon: <IoIcons.IoMdAnalytics/>
    },

    {
        title: 'dfsfdjjdjjd',
        path: '/overview',
        icon: <IoIcons.IoMdAnalytics/>
    },

    {
        title: 'Messages',
        path: '/messages',
        icon: <FaIcons.FaEnvelopeOpenText/>,

        iconClosed: <RiIcons.RiArrowDownSFill/>,
        iconOpened: <RiIcons.RiArrowUpSFill/>,

        subNav: [
            {
                title: 'Message 1',
                path: '/messages/message1',
                icon: <IoIcons.IoIosPaper/>
            },
            {
                title: 'Message 2',
                path: '/messages/message2',
                icon: <IoIcons.IoIosPaper/>
            }
        ]
    },
    {
        title: 'Support',
        path: '/support',
        icon: <IoIcons.IoMdHelpCircle/>
    },
    {
        title: 'Top Validators',
        path: '#',
        icon: <IoIcons.IoMdHelpCircle/>,

        iconClosed: <RiIcons.RiArrowDownSFill/>,
        iconOpened: <RiIcons.RiArrowUpSFill/>,

        subNav: [
            {
                title: 'By Most Token Amount',
                path: '/validators/tokens',
                icon: <IoIcons.IoIosPaper/>
            },
            {
                title: 'By Least Commission',
                path: '/validators/commission',
                icon: <IoIcons.IoIosPaper/>
            },
            {
                title: 'By Most Voting Power',
                path: '/validators/votingPower',
                icon: <IoIcons.IoIosPaper/>
            },
            {
                title: 'By Most Prosperity Priority',
                path: '/validators/prosperityPriority',
                icon: <IoIcons.IoIosPaper/>
            },
            {
                title: 'By Total Tokens Delegated',
                path: '/validators/tokensDelegated',
                icon: <IoIcons.IoIosPaper/>
            }//,
            // {
            //     title: 'By Most Number of Delegators',
            //     path: '/validators/numberOfDelegators',
            //     icon: <IoIcons.IoIosPaper/>
            // },
        ]
    }

];
